import React, { useState, useEffect } from 'react';
import { Box, CssBaseline, CircularProgress, Typography } from '@mui/material';
import { styled } from '@mui/material/styles';
import {
  VideoCall as VideoIcon,
  OpenInFull as ExpandIcon,
  MoreVert as MoreIcon,
} from '@mui/icons-material';
import ChatWindow from './components/ChatWindow';

const AppContainer = styled(Box)(({ theme }) => ({
  display: 'flex',
  height: '100vh',
  backgroundColor: theme.palette.primary.dark,
  padding: theme.spacing(2),
}));

const ChatContainer = styled(Box)(({ theme }) => ({
  display: 'flex',
  gap: theme.spacing(2),
  width: '100%',
  maxWidth: 1600,
  margin: '0 auto',
  height: '100%',
}));

const LoadingContainer = styled(Box)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  justifyContent: 'center',
  gap: theme.spacing(2),
  width: '100%',
  color: theme.palette.common.white,
}));

function App() {
  const [models, setModels] = useState([]);
  const [streamingResponses, setStreamingResponses] = useState({ left: '', right: '' });
  const [thinking, setThinking] = useState({ left: false, right: false });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchModels = async () => {
      try {
        const response = await fetch('http://192.168.56.1:1234/v1/models');
        if (!response.ok) {
          throw new Error(`Server returned ${response.status}: ${response.statusText}`);
        }
        const data = await response.json();
        if (!data.data || !Array.isArray(data.data)) {
          throw new Error('Invalid response format from server');
        }
        setModels(data.data.map(model => ({
          id: model.id,
          name: model.id
        })));
        setError(null);
      } catch (error) {
        console.error('Error fetching models:', error);
        setError(error.message);
      } finally {
        setLoading(false);
      }
    };

    const initializeApp = async () => {
      await fetchModels();
      // Set up polling for model updates
      const interval = setInterval(fetchModels, 30000);
      return () => clearInterval(interval);
    };

    initializeApp();
  }, []);

  if (loading) {
    return (
      <AppContainer>
        <CssBaseline />
        <LoadingContainer>
          <CircularProgress color="inherit" size={40} />
          <Typography variant="h6">
            Connecting to AI Server...
          </Typography>
        </LoadingContainer>
      </AppContainer>
    );
  }

  if (error) {
    return (
      <AppContainer>
        <CssBaseline />
        <LoadingContainer>
          <Typography variant="h6" color="error">
            Unable to connect to AI Server
          </Typography>
          <Typography variant="body1" color="error.light">
            {error}
          </Typography>
          <Typography variant="body2" sx={{ opacity: 0.7, mt: 1 }}>
            Please check your connection and refresh the page
          </Typography>
        </LoadingContainer>
      </AppContainer>
    );
  }

  return (
    <AppContainer>
      <CssBaseline />
      <ChatContainer>
        <ChatWindow
          position="left"
          models={models}
          streamingResponse={streamingResponses.left}
          isThinking={thinking.left}
          setStreamingResponses={setStreamingResponses}
          setThinking={setThinking}
        />
        <ChatWindow
          position="right"
          models={models}
          streamingResponse={streamingResponses.right}
          isThinking={thinking.right}
          setStreamingResponses={setStreamingResponses}
          setThinking={setThinking}
        />
      </ChatContainer>
    </AppContainer>
  );
}

export default App;
